style.css:
@-moz-document domain("www.hurriyet.com.tr") {
/* main page */

.ad-all-contain {
    display: none !important;
}
/* right-left full screen images*/

.dfp-header-728x90 {
    display: none !important;
}
/* multiple banner ads*/

[data-ad-div-id] {
    display: none !important;
}
/* multiple ad blocked via attribute select */

.boomads {
    display: none !important;
}
/* multiple ad blocked */
}

@-moz-document domain("www.hurriyet.com.tr") {
/* news page */

.pageskin-top,
.pageskin-left,
.pageskin-right {
    display: none !important;
}
/* page skin removal */

#Medyanet_Ad_Models_Interstitial_Container_Inner {
    display: none !important;
}
/* random fullscreen ad */

#Medyanet_Site_Background,
#Medyanet_Gravity_Spacer {
    display: none !important;
}
/* random parallax fullscreen ad */

#plusNewsListRightBlock {
    display: none !important;
}
/* sponsored news / ads in the right */
}

@-moz-document domain("www.hurriyet.com.tr") {
/* logo degistirmece */

.main-logo > a {
    display: none !important;
}
.main-logo {
    height: 38px !important;
    background-image: url('data:image/jpeg;base64,') !important;
    background-size: contain !important;
}
}
